import React from 'react'

export default function FeaturedDog() {
  return (
    <div className="dog-img-div">
        <img src="https://place.dog/300/200" alt="dog" className="dog-img"/>
        <img src="https://place.dog/250/200" alt="dog" className="dog-img"/>
        <img src="https://place.dog/320/200" alt="dog" className="dog-img"/>
        <img src="https://place.dog/230/300" alt="dog" className="dog-img"/>
        { //<img src="https://place.dog/250/400" alt="dog" className="dog-img"/>
        //<img src="https://place.dog/320/320" alt="dog" className="dog-img"/>
        //<img src="https://place.dog/350/400" alt="dog" className="dog-img"/>
      }
    </div>
  )
}
